import {Link} from 'react-router-dom';
import { useContext,useState } from 'react';

const Home = () => {
  const [workouts, setWorkouts] = useState([{ "id" : 1,
    type: "Push",
    date : "7/26/2024",
  }])
    return (
        <div className = 'home'>
            <title>
              Gym Tracker Site
            </title>
            <nav>
                <button>
                    <Link to="/create" className='link'>Add a Workout</Link>
                </button>
            </nav>
            
            <div>
              <h2> Previous Workouts</h2>
              {workouts.map((workout)=> (
                <div className="workout-preview" key={workouts.id}>
                      <h2>{workout.type}</h2>
                      <p>{workout.date}</p>
                      <br />
                </div> 
              ))}
            </div>
            
            
           
        </div>
    );
}
 
export default Home;
